  namespace: Pelias.NET.Model.Interfaces.GeographicInformationSystems
  summary: >-
    Represents an interface for a geographic feature, extending the general entity interface,

    with properties, geometry, and bounding box information.
  example: []
  syntax:
    content: 'public interface IFeature<TProperties, TGeometry, TBoundingBox, TCoordinates, TAngle> : IEntity where TProperties : IProperties where TGeometry : IGeometry<TBoundingBox, TCoordinates, TAngle> where TBoundingBox : IBoundingBox<TCoordinates, TAngle> where TCoordinates : ICoordinates<TAngle> where TAngle : IAngle'
    typeParameters:
    - id: TProperties
      description: The type representing properties of the feature.
    - id: TGeometry
      description: The type representing the geometry of the feature.
    - id: TBoundingBox
      description: The type representing the bounding box of the feature.
    - id: TCoordinates
      description: The type representing the coordinates of the feature.
    - id: TAngle
      description: The type representing an angle measurement.
